local h = game:GetService("HttpService")

function getjson(url)
    local begin = game:HttpGet("https://aut.matthew-gamerga.repl.co/get?url="..url)
    if (begin == 'the file size is too big!') then
        return 'fstb'
    else
        local json = h:JSONDecode(begin)
        return json
    end
end

